    Mexico's gross receipts tax districts asnidentified on the "Gross Receipts Tax
    Rate Schedule" published by the Taxation and RevenuenDepartment. Initial municipal
    boundaries acquired from RGIS and based on layers developed by thenEarth Data Analysis
